INSERT INTO Bots VALUES(76,'591595831258251264','n.','289418396867624960','–ü—Ä–∏–≤–µ—Ç, –∫–∞–ø–∏—Ç–∞–Ω, –º–µ–Ω—è –∑–æ–≤—É—Ç Narmayaü¶ã.',replace('> `(‚à™ÔΩ°‚à™)ÔΩ°ÔΩ°ÔΩ°zzZ`\n> `Ÿ©(Àä„ÄáÀã*)Ÿà` –§–≤–∞–∞—Ö... –ö—É—É... –§–≤–∞–∞?!\n> –ó–¥—Ä–∞–≤—Å—Ç–≤—É–π—Ç–µ, –∫–∞–ø–∏—Ç–∞–Ω! –ù–µ—Ç, —è –Ω–µ —Å–ø–∞–ª–∞ —Å–µ–π—á–∞—Å!\n> –ß—Ç–æ?! –ö–∞–ø–∏—Ç–∞–Ω, —Ö–æ—Ç–∏—Ç–µ —É–∑–Ω–∞—Ç—å –æ–±–æ –º–Ω–µ –ø–æ–±–æ–ª—å—à–µ? –Ø —Ç–∞–∫ —Å—á–∞—Å—Ç–ª–∏–≤–∞! `(„ÄÉ Ôºæ ‚ñΩ Ôºæ „ÄÉ)`\n\n#### –ù–∞—á–Ω–µ–º —Å —Ç–æ–≥–æ, —á—Ç–æ –º–µ–Ω—è –∑–æ–≤—É—Ç **_Narmaya_** (–í—Ä–µ–º—è –∑–∞–ø–æ–º–Ω–∏—Ç—å `( Õ†¬∞ Õü ñ Õ°¬∞)`).\n\n#### –Ø –º–æ–≥—É —Ä–∞–∑–≤–ª–µ—á—å —Ç–µ–±—è –≤ —Ç—Ä—É–¥–Ω—ã–µ –≤—Ä–µ–º–µ–Ω–∞:\n\n - –ü–µ—Ä–µ–≤–æ–¥ —Ç–µ–∫—Å—Ç–∞ –Ω–∞ –∫—Ä–∞—Å–∏–≤—ã–π, –æ–±—ä–µ–º–Ω—ã–π ASCII —Ç–µ–∫—Å—Ç, –ø—Ä–æ—Å—Ç–æ —Å–∫–∞–∂–∏—Ç–µ –º–Ω–µ `n.ascii –≤–∞—à —Ç–µ–∫—Å—Ç –∑–¥–µ—Å—å`.\n - –ï—Å–ª–∏ –≤—ã —Å–∫–∞–∂–µ—Ç–µ –º–Ω–µ `n.delete @user`, —Ç–æ —è —Å–±—Ä–æ—à—É —à—É—Ç–æ—á–Ω–æ–µ —É–≤–µ–¥–æ–º–ª–µ–Ω–∏–µ –æ–± —É–¥–∞–ª–µ–Ω–∏–∏ —É–ø–æ–º—è–Ω—É—Ç–æ–≥–æ –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è.\n - –ï—Å–ª–∏ –º—ã –≤–¥–≤–æ–µ–º —Å–º–æ–∂–µ–º –ø–æ–∏–≥—Ä–∞—Ç—å –≤ –∫–∞–º–µ–Ω—å-–Ω–æ–∂–Ω–∏—Ü—ã-–±—É–º–∞–≥–∏, —Å–∫–∞–∂–∏—Ç–µ `n.rps`, –∫–æ–≥–¥–∞ –±—É–¥–µ—Ç–µ –≥–æ—Ç–æ–≤—ã –ø—Ä–æ–∏–≥—Ä–∞—Ç—å `(¬¨¬¨‚Äø¬¨)`.\n\n#### –Ø —Ç–∞–∫–∂–µ –º–æ–≥—É —Ä–∞—Å—Å–∫–∞–∑–∞—Ç—å –≤–∞–º –∏ –ø–æ–∫–∞–∑–∞—Ç—å –¥—Ä—É–≥—É—é –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏—é:\n\n - –í–æ—Ç —Ç–∞–±–ª–∏—á–∫–∞ —Å `n.help`, –ø—Ä–æ—Å—Ç–æ–π –∫–∞—Ä—Ç–æ—á–Ω—ã–π —Å–ø–∏—Å–æ–∫ –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏–∏, –µ—Å–ª–∏ –≤—ã —Ö–æ—Ç–∏—Ç–µ —É–∑–Ω–∞—Ç—å –±–æ–ª—å—à–µ, –ø—Ä–æ—Å—Ç–æ —É–∫–∞–∂–∏—Ç–µ, —á—Ç–æ –≤—ã —Ö–æ—Ç–∏—Ç–µ, —è –≤–∞–º –ø–æ–º–æ–≥—É `(oÔΩ•œâÔΩ•o)`.\n - –°–∫–∞–∂–∏ "—Å—ã—Ä", —Ç—ã –Ω–∞ –∫–∞–º–µ—Ä–µ! –°–∫–∞–∂–∏—Ç–µ `n.avatar @user` –∏ —è –ø–æ–∫–∞–∂—É –≤–∞–º —Ñ–æ—Ç–æ–≥—Ä–∞—Ñ–∏—é –≤–∞—Å –∏–ª–∏ —É–ø–æ–º—è–Ω—É—Ç–æ–≥–æ –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è.\n - –ù–µ–Ω–∞–≤–∏–∂—É `n.botinfo` –æ–Ω –ø–æ–∫–∞–∑—ã–≤–∞–µ—Ç –ø–æ—á—Ç–∏ –≤—Å—é –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏—é –æ–±–æ –º–Ω–µ `(√íÔπè√ì)`.\n - –° –ø–æ–º–æ—â—å—é `n.ping` —è –¥–æ–ª–∂–Ω–∞ –æ—Ç–≤–µ—Ç–∏—Ç—å –∫–∞–∫ –º–æ–∂–Ω–æ –±—ã—